export function removeDuplicates(r){if(Array.isArray(r))return r.filter(function(r,t,e){return t===e.indexOf(r)});throw r+" is not an array."}export function searchInObject(r,t){if("object"==typeof r){"string"==typeof t&&(t=t.toLowerCase());for(let e=0;e<r.length;e++)for(let n in r[e]){if(r[e][n]===t)return r[e];if("string"==typeof r[e][n]&&r[e][n].toLowerCase()===t)return r[e]}throw"Couldn't find "+t+" in "+r}throw r+" is not an object."}export function arrayFind(r,t){let e=!1;if(!Array.isArray(r))throw r+" is not an array.";if(void 0===t)throw"Missing parameter.";switch(t){case"min":if(e=Math.min.apply(Math,r),!isNaN(e))return e;for(let t=0;t<r.length;t++)isNaN(r[t])||(isNaN(e)?e=r[t]:r[t]<e&&(e=r[t]));break;case"max":if(e=Math.max.apply(Math,r),!isNaN(e))return e;for(let t=0;t<r.length;t++)isNaN(r[t])||(isNaN(e)?e=r[t]:r[t]>e&&(e=r[t]));break;default:e=occurrences(r.join(""),t)}return e}export function occurrences(r,t,e){if(r+="",(t+="").length<=0)return r.length+1;let n=0,i=0,a=e?1:t.length;for(;(i=r.indexOf(t,i))>=0;)++n,i+=a;return n}export function countOccurences(r){if(Array.isArray(r)){let t={};for(let e=0;e<r.length;++e)t[r[e]]||(t[r[e]]=0),++t[r[e]];return t}throw r+" is not an array."}